const Experience = (props) => {
    const {name, image, location, rating, price} = props.review;
    return (
        <div>
            <img src={image} alt="" />
            <h6>{location}</h6>
            <h5>{name}</h5>
            <p>{price}</p>
            <div>
                <span><img src={rating} alt="" /></span>
                <span><img src={rating} alt="" /></span>
                <span><img src={rating} alt="" /></span>
                <span><img src={rating} alt="" /></span>
                <span><img src={rating} alt="" /></span>
            </div>
        </div>
    );
};

export default Experience;
